import React from "react";
import "./VideosSection.css";

const VideosSection = () => {
  return (
    <section id="videos" className="section videos">
      <h2>Vidéos</h2>
      <p>Regardez les dernières vidéos d'anime et de culture geek.</p>
    </section>
  );
};

export default VideosSection;
